import React from 'react';
import './App.css'
const Cardcss={
      backgroundColor:'#F1E9DB',
      margin: '10px 0px 10px 0px',
      width: '300px',
      height: '300px',
  }
const btnCss={color:"#B3001B",
  fontSize:"18px",
  fontWeight:"800",
  padding:'3px',
  marginLeft:'10%',
  borderRadius:'5px',
  outline:'none',
  cursor:'pointer',
}
function Cards(props){
  return(
    <>
      <div className="Card" style={Cardcss}>
        <img src={props.src} width='100%' height='60%'/>

        <div className="CardInfo">
          <div className="title" style={{color:"white",
          fontWeight:"800",fontFamily:"sans-serif"}}>
          <h2>{props.title}</h2></div>
          <button style={btnCss}>Watch NOW</button>
        </div>

      </div>
    </>
  )
}
export default Cards;
